import css from '../CreateFinger/CreateFinger.module.css';

const strings = {
  0: 'string_none',
  1: 'string_one',
};

export function CreateFinger({ finger, fret }) {
  const fin = strings[finger];
  console.log(fin);
  return <div className={clsx(fin)}>finger</div>;
}
